import React, { Component } from 'react';
import { NavLink } from 'react-router-dom'
import Carousel from 'react-bootstrap/Carousel'
import './index.css';


class MainBody extends Component {


  render(){

    return (
        <Carousel>
          <Carousel.Item>
            Joe
          </Carousel.Item>
          <Carousel.Item>
            Kelsey
          </Carousel.Item>
          <Carousel.Item>
            John
          </Carousel.Item>
          <Carousel.Item>
            Jessica
          </Carousel.Item>
        </Carousel>
    );
  }
}

export default MainBody;
